import React from 'react';
import { NavLink } from 'react-router-dom';
import './Navbarc.css';

const Appbar = () => {
    //const classes = useStyles();
    return(
        <div>
            <h6>
                Slate
            </h6>

            <input type = "button"><NavLink className = "inactive" activeClassName = "active" to = "/">Home</NavLink></input>
            <input type = "button"><NavLink className = "inactive" activeClassName = "active" to = "/signup">Signup</NavLink></input>
            <input type = "button"><NavLink className = "inactive" activeClassName = "active" to = "/login">Login</NavLink></input>
            <input type = "button"><NavLink className = "inactive" activeClassName = "active" to = "/splash">Splash</NavLink></input>
            <input type = "button"><NavLink className = "inactive" activeClassName = "active" to = "/pp">Profile/Feed</NavLink></input>
        </div>
    );
}

class Navbar extends React.Component {

    constructor(props){
        super(props);
    }

    render(){
        return(
            <div>
                <Appbar/>
            </div>
        );
    }
}

export default Navbar;
